import React,{useState} from 'react'
import './App.css';

export const Login=()=>{
    const[loginEmail, setLoginEmail]=useState('');
    const[loginPass, setLoginPass]=useState('')
  return (
    <>
    <h1>ログイン画面</h1>
    <form>
      <div>
        <label>メールアドレス</label>
        <input
          name='email'
          type='email'
          value={loginEmail}
          onChange={e=>setLoginEmail(e.target.value)}
        />
      </div>
      <div>
        <label>パスワード</label>
        <input
          name='password'
          type='password'
          value={loginPass}
          onChange={e=>setLoginPass(e.target.value)}
        />
      </div>
    </form>
    </>
  );
}
